from itertools import count, takewhile
def ok(n):
  s = str(n*n); return len(s.rstrip("9")) == len(s.lstrip("9")) == len(s)-1
def aupto(N):
  r = takewhile(lambda x: x<=N, (10*i+d for i in count(0) for d in [3, 7]))
  return [k for k in r if ok(k)]
